                    b.Property<int>("value")
                        .HasColumnType("integer");

                    b.HasKey("id");

                    b.ToTable("door_access_control_flag");

                    b.HasData(
                        new
                        {
                            id = 1,
                            description = "ACR_F_DCR	0x0001	\r\n🔹 Purpose: Decrements a user’s “use counter” when they successfully access.\r\n🔹 Effect: Each valid access reduces their remaining allowed uses.\r\n🔹 Use Case: Temporary or limited-access credential (e.g., one-time use visitor cards or tickets).",
                            name = "Decrease Counter",
                            value = 1
                        },
                        new
                        {
                            id = 2,
                            description = "ACR_F_CUL	0x0002	\r\n🔹 Purpose: Requires that the use limit is non-zero before granting access.\r\n🔹 Effect: If the use counter reaches zero, access is denied.\r\n🔹 Use Case: Works together with ACR_F_DCR for managing credential with limited usage.",
                            name = "Deny Zero",
                            value = 2
                        },
                        new
                        {
                            id = 3,
                            description = "ACR_F_DRSS	0x0004	\r\n🔹 Purpose: Deny duress access requests.\r\n🔹 Effect: Normally, a duress PIN (like a special emergency PIN) grants access but logs a “duress” event. This flag changes that behavior — access is denied instead, but still logged.\r\n🔹 Use Case: High-security environments where duress entries should never open the door (only alert security).",
                            name = "Denu Duress",
                            value = 4
                        },
                        new
                        {
                            id = 4,
                            description = "ACR_F_ALLUSED	0x0008	\r\n🔹 Purpose: Treat all access grants as “used” immediately — don’t wait for door contact feedback.\r\n🔹 Effect: When access is granted, the system immediately logs it as used, even if the door sensor doesn’t open.\r\n🔹 Use Case: For systems with no door contact sensor, or for virtual reader (logical access).",
                            name = "No sensor door",
                            value = 8
                        },
                        new
                        {
                            id = 5,
                            description = "ACR_F_QEXIT	0x0010	\r\n🔹 Purpose: “Quiet Exit” — disables strike relay activation on REX (Request to Exit).\r\n🔹 Effect: When someone exits, the strike is not pulsed — useful for magnetic locks or silent egress door.\r\n🔹 Use Case: Hospital wards, offices, or area where audible clicks must be minimized.",
                            name = "Quit Exit",
                            value = 16
                        },
                        new
                        {
                            id = 6,
                            description = "ACR_F_FILTER	0x0020	\r\n🔹 Purpose: Filter out detailed door state change transactions (like every open/close event).\r\n🔹 Effect: Reduces event log noise — only key events (grants, denies) are logged.\r\n🔹 Use Case: Typically enabled in production. Disable only if you need fine-grained door state diagnostics.",
                            name = "door State Filter",
                            value = 32
                        },
                        new
                        {
                            id = 7,
                            description = "ACR_F_2CARD	0x0040	\r\n🔹 Purpose: Enables two-card control — requires two different valid cards before access is granted.\r\n🔹 Effect: The system waits for a second credential (often within a timeout period).\r\n🔹 Use Case: High-security door or vaults where two people must be present (dual authentication).",
                            name = "Two man rules",
                            value = 64
                        },
                        new
                        {
                            id = 8,
                            description = "ACR_F_HOST_CBG	0x0400	\r\n🔹 Purpose: If online, check with the host server before granting access.\r\n🔹 Effect: The controller sends the access request to the host; the host can grant or deny.\r\n🔹 Use Case: Centralized decision-making — e.g., dynamic permissions, host-based rules, or temporary card revocations.\r\n🔹 Note: Often used together with ACR_FE_HOST_BYPASS in the extended flags.",
                            name = "Host Decision",
                            value = 1024
                        },
                        new
                        {
                            id = 9,
                            description = "ACR_F_HOST_SFT	0x0800	\r\n🔹 Purpose: Defines offline failover behavior.\r\n🔹 Effect: If the host is unreachable or times out, the controller proceeds to grant access using local data instead of denying.\r\n🔹 Use Case: Ensures continuity of access during temporary network outages.\r\n🔹 Note: Use with caution — enables access even when host verification fails.",
                            name = "Offline Grant",
                            value = 2048
                        },
                        new
                        {
                            id = 10,
                            description = "ACR_F_CIPHER	0x1000	\r\n🔹 Purpose: Enables Cipher mode (numeric keypad emulates card input).\r\n🔹 Effect: Allows the user to type their card number on a keypad instead of presenting a physical card.\r\n🔹 Use Case: For environments with numeric-only access or backup credential entry.\r\n🔹 Reference: See command 1117 (trigger Specification) for keypad mapping.",
                            name = "Cipher mode",
                            value = 4096
                        },
                        new
                        {
                            id = 11,
                            description = "ACR_F_LOG_EARLY	0x4000	\r\n🔹 Purpose: Log access transactions immediately upon grant — before door usage is confirmed.\r\n🔹 Effect: Creates an instant “Access Granted” event, then later logs “Used” or “Not Used.”\r\n🔹 Constraint: Automatically disabled if ACR_F_ALLUSED (0x0008) is set.\r\n🔹 Use Case: Real-time systems that require immediate event logging (e.g., monitoring dashboards).",
                            name = "Log Early",
                            value = 16384
                        },
                        new
                        {
                            id = 12,
                            description = "ACR_F_CNIF_WAIT	0x8000	\r\n🔹 Purpose: Changes “Card Not in File” behavior to show ‘Wait’ pattern instead of “Denied.”\r\n🔹 Effect: The reader shows a temporary wait indication (e.g., blinking LED) — useful when waiting for host validation.\r\n🔹 Use Case: Online reader with host delay — improves user feedback for cards that might soon be recognized after sync.\r\n🔹 Reference: See command 122 (Reader LED/Buzzer Function Specs).",
                            name = "Wait for Card in file",
                            value = 32768
                        });
                });

